-- | Identifier type
--
-- @since 0.1.0
data IdentifierType
    = NotCharacter
    -- ^ Unassigned characters, private use characters, surrogates,
    -- non-whitespace control characters.
    | Deprecated
    -- ^ Characters with the Unicode property @Deprecated=Yes@.
    | DefaultIgnorable
    -- ^ Characters with the Unicode property @Default_Ignorable_Code_Point=Yes@.
    | NotNFKC
    -- ^ Characters that cannot occur in strings normalized to NFKC.
    | NotXID
    -- ^ Characters that do not qualify as default Unicode identifiers;
    -- that is, they do not have the Unicode property XID_Continue=True.
    | Exclusion
    -- ^ Characters with @Script_Extensions@ values containing a script
    -- in /Excluded Scripts/, and no script from /Limited Use Scripts/
    -- or /Recommended Scripts/, other than “Common” or “Inherited”.
    | Obsolete
    -- ^ Characters that are no longer in modern use, or that are not
    -- commonly used in modern text.
    | Technical
    -- ^ Specialized usage: technical, liturgical, etc.
    | UncommonUse
    -- ^ Characters that are uncommon, or are limited in use, or
    -- whose usage is uncertain.
    | LimitedUse
    -- ^ Characters from scripts that are in limited use.
    | Inclusion
    -- ^ Exceptionally allowed characters.
    | Recommended
    -- ^ Characters from scripts that are in widespread everyday common use.
    deriving (Eq, Ord, Bounded, Enum, Show)

-- | Useful to decode the output of 'identifierTypes'.
decodeIdentifierTypes :: Int -> NonEmpty IdentifierType
decodeIdentifierTypes = \case
    0 -> [NotCharacter]
    1 -> [Deprecated]
    2 -> [DefaultIgnorable]
    3 -> [NotNFKC]
    4 -> [NotXID]
    5 -> [Exclusion]
    6 -> [Exclusion,NotXID]
    7 -> [Obsolete]
    8 -> [Obsolete,NotXID]
    9 -> [Technical]
    10 -> [Technical,NotXID]
    11 -> [Technical,Exclusion]
    12 -> [Technical,Obsolete]
    13 -> [Technical,Obsolete,NotXID]
    14 -> [UncommonUse]
    15 -> [UncommonUse,NotXID]
    16 -> [UncommonUse,Exclusion]
    17 -> [UncommonUse,Obsolete]
    18 -> [UncommonUse,Obsolete,NotXID]
    19 -> [UncommonUse,Technical]
    20 -> [UncommonUse,Technical,NotXID]
    21 -> [LimitedUse]
    22 -> [LimitedUse,NotXID]
    23 -> [LimitedUse,Exclusion]
    24 -> [LimitedUse,Obsolete]
    25 -> [LimitedUse,Technical]
    26 -> [Inclusion]
    27 -> [Recommended]
    _ -> [NotCharacter]

-- | Returns the 'IdentifierType's corresponding to a character.
{-# INLINE identifierTypes #-}
identifierTypes :: Char -> Int
identifierTypes c
    -- Planes 0-3
    | cp < 0x323B0 = lookupIntN bitmap# cp
    -- Planes 4-13: 0
    | cp < 0xE0000 = 0
    -- Plane 14
    | cp < 0xE01F0 = lookupIntN bitmap# (cp - 0xADC50)
    -- Default: 0
    | otherwise = 0
    where
    cp = ord c
    !(Ptr bitmap#) = identifierTypesBitmap

